import './App.css';
import Footer from './Components/Footer';
import Hero from './Components/Hero';
import Navabar from './Components/Navabar';
import Section1 from './Components/Section1';
import Section2 from './Components/Section2';

function App() {
  return (
    <div>
      <Navabar/>
      <Hero />
      <Section1/>
      <Section2/>
      <Footer/>
    </div>
  );
}

export default App;
